import { useState, useRef, useEffect } from "react";
import { Github, Mail } from "lucide-react";
import "./App.css";
import darkblue from "./assets/darkblue.mp4";

export default function Component() {
  const [isLogin, setIsLogin] = useState(true);
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [role, setRole] = useState(""); // Role (Student or Faculty)
  const [classSelection, setClassSelection] = useState("");
  const [yearSelection, setYearSelection] = useState("");
  const [designation, setDesignation] = useState("");
  const [error, setError] = useState("");

  const videoRef = useRef(null);

  useEffect(() => {
    if (videoRef.current) {
      videoRef.current.play().catch((error) => {
        console.error("Error attempting to play video: ", error);
      });
    }
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");

    if (!isLogin && password !== confirmPassword) {
      setError("Passwords do not match");
      return;
    }

    const endpoint = isLogin ? "/login" : "/signup";

    try {
      const response = await fetch(`http://localhost:5000/api${endpoint}`, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          email,
          password,
        }),
      });

      const data = await response.json();

      if (response.ok) {
        alert("Authentication successful");
      } else {
        setError(data.message || "Something went wrong");
      }
    } catch (err) {
      setError("Network error, please try again later");
      console.error("Error connecting to backend:", err);
    }
  };

  const handleRoleChange = (e) => {
    setRole(e.target.value);
    // Reset specific fields when role changes
    setClassSelection("");
    setYearSelection("");
    setDesignation("");
  };

  return (
    <div className="overlay">
      <div id="gradient-overlay"></div>
      <video ref={videoRef} id="background-video" loop autoPlay muted>
        <source src={darkblue} type="video/mp4" />
        Your browser does not support the video tag.
      </video>
      <header className="header">
        <nav className="navbar">
          <ul className="nav-links">
            <li>
              <button className="nav-button">Home</button>
            </li>
            <li>
              <button className="nav-button">Explore</button>
            </li>
            <li>
              <button className="nav-button">Blog</button>
            </li>
            <li>
              <button className="nav-button">Services</button>
            </li>
          </ul>
        </nav>
      </header>

      <div className="container">
        <div className="card">
          <div className="card-header">
            <h2>{isLogin ? "Login" : "Sign Up"}</h2>
            <p>Welcome! Please {isLogin ? "log in" : "create an account"} to continue.</p>
          </div>

          <div className="auth-options">
            <button className="auth-button">
              <Github className="icon" />
              Github
            </button>
            <button className="auth-button">
              <Mail className="icon" />
              Email
            </button>
          </div>

          <div className="divider">
            <span>OR</span>
          </div>

          <div className="toggle-container">
            <label>Login</label>
            <input
              type="checkbox"
              className="toggle-switch"
              checked={!isLogin}
              onChange={() => setIsLogin(!isLogin)}
            />
            <label>Sign Up</label>
          </div>

          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <label>Email</label>
              <input
                type="email"
                className="input-field"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
              />
            </div>

            <div className="form-group">
              <label>Password</label>
              <input
                type="password"
                className="input-field"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
              />
            </div>

            {!isLogin && (
              <>
                <div className="form-group">
                  <label>Confirm Password</label>
                  <input
                    type="password"
                    className="input-field"
                    value={confirmPassword}
                    onChange={(e) => setConfirmPassword(e.target.value)}
                    required
                  />
                </div>

                <div className="form-group">
                  <label>Role</label>
                  <select
                    className="input-field"
                    value={role}
                    onChange={handleRoleChange}
                    required
                  >
                    <option value="">Select Role</option>
                    <option value="Student">Student</option>
                    <option value="Faculty">Faculty</option>
                  </select>
                </div>

                {role === "Student" && (
                  <>
                    <div className="form-group">
                      <label>Class</label>
                      <input
                        type="text"
                        className="input-field"
                        value={classSelection}
                        onChange={(e) => setClassSelection(e.target.value)}
                        required
                      />
                    </div>

                    <div className="form-group">
                      <label>Year</label>
                      <input
                        type="text"
                        className="input-field"
                        value={yearSelection}
                        onChange={(e) => setYearSelection(e.target.value)}
                        required
                      />
                    </div>
                  </>
                )}

                {role === "Faculty" && (
                  <div className="form-group">
                    <label>Designation</label>
                    <input
                      type="text"
                      className="input-field"
                      value={designation}
                      onChange={(e) => setDesignation(e.target.value)}
                      required
                    />
                  </div>
                )}
              </>
            )}

            <div className="form-group">
              {error && <p className="error">{error}</p>}
              <button type="submit" className="submit-button">
                {isLogin ? "Log In" : "Sign Up"}
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}
